import React from 'react'
import { useEffect, useState, useContext } from 'react';
import DoctorSlotAdd from './DoctorSlotAdd'
import DoctorSlotList from './DoctorSlotList';
import axios from 'axios';
import { BASEURL } from './baseURL';
import { AppContext } from './App';


function DoctorHomePage() {

    const [dateTime, setDateTime] = useState("");
    const [slotList, setSlotList] = useState([]);
    const {id, setDoctorId} = useContext(AppContext);

    useEffect(()=>{
        
       // const id = localStorage.getItem("id");
        //console.log(localStorage.getItem("id"));
        axios.get(BASEURL + `/profile/doctor_profile_details/${id}`,{
        }).then(function (response) {
            console.log(response);
            localStorage.setItem("doctor_id",JSON.stringify(response.data["id"]));
          })
          .catch(function (error) {
            console.log(error);
        });
    }, [])


  return (
    <div>
        DOC HOME PAGE
        <DoctorSlotAdd 
            dateTime = {dateTime}
            setDateTime = {setDateTime}
            slotList = {slotList}
            setSlotList = {setSlotList}/>
        <DoctorSlotList 
            dateTime = {dateTime}
            setDateTime = {setDateTime}
            slotList = {slotList}
            setSlotList = {setSlotList}/>
    </div>
  )
}

export default DoctorHomePage
